import { Component, Inject, OnInit } from '@angular/core';
import {MAT_DIALOG_DATA, MatDialogRef} from "@angular/material/dialog";

@Component({
  selector: 'app-meditation-summary-component',
  templateUrl: './meditation-summary-component.component.html',
  styleUrls: ['./meditation-summary-component.component.css']
})
export class MeditationSummaryComponentComponent implements OnInit {

  minutes: number = 0;
  distractions: number = 0;

  constructor(private dialogRef: MatDialogRef<MeditationSummaryComponentComponent>,
    @Inject(MAT_DIALOG_DATA) data : any) { 
      this.minutes = data.minutes;
      this.distractions = data.distractions;
    }

  ngOnInit(): void {
  }

}
